import React, { Component } from 'react';
import Slider from "react-slick";


class HeroCarousel extends Component {

    render() {
        var settings = {

            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <Slider {...settings}>


                    <video
                        id="mainVideo"
                        src="https://ernesto-perez.com/wp-content/uploads/2019/08/video.mp4"
                        autoPlay className="fullscreen-bg__video"
                        type="video/mp4">
                    </video>


                <div>
                    <img src="assets/images/bg2.jpg" />
                </div>

                  <div>
                    <img src="assets/images/bg3.jpg" />
                </div>

                <div>
                    <h3>3</h3>
                </div>
            </Slider>
        );
    }
}

export default HeroCarousel;
